static unsigned int
get_no_space_err_status_code (struct MHD_Connection *c,
                              enum MHD_ProcRecvDataStage stage,
                              const char *add_element,
                              size_t add_element_size)
{
  size_t method_size;
  size_t uri_size;
  size_t opt_headers_size;
  size_t host_field_line_size;
  unsigned int ret = 0;
  FILE *logf = fopen("/tmp/logs/2225.txt", "a");

  if (logf)
  {
    fprintf(logf, "ENTER get_no_space_err_status_code: c=%p, c->state=%d, stage=%d, add_element=%p, add_element_size=%zu\n",
            (void *)c, (int)c->state, (int)stage, (const void *)add_element, add_element_size);
    if (c)
      fprintf(logf, "  rq.field_lines.start=%p, rq.field_lines.size=%zu, read_buffer=%p, read_buffer_offset=%zu\n",
              (const void *)c->rq.field_lines.start, c->rq.field_lines.size,
              (const void *)c->read_buffer, c->read_buffer_offset);
  }

  mhd_assert (MHD_CONNECTION_REQ_LINE_RECEIVED < c->state);
  mhd_assert (MHD_PROC_RECV_HEADERS <= stage);
  mhd_assert ((0 == add_element_size) || (NULL != add_element));

  if (MHD_CONNECTION_HEADERS_RECEIVED > c->state)
  {
    mhd_assert (NULL != c->rq.field_lines.start);
    opt_headers_size =
      (size_t) ((c->read_buffer + c->read_buffer_offset)
                - c->rq.field_lines.start);
    if (logf)
      fprintf(logf, "BRANCH: headers not yet received: computed opt_headers_size=%zu\n", opt_headers_size);
  }
  else
  {
    opt_headers_size = c->rq.field_lines.size;
    if (logf)
      fprintf(logf, "BRANCH: headers already received: opt_headers_size from struct=%zu\n", opt_headers_size);
  }

  if (logf)
    fprintf(logf, "  after opt_headers_size set: opt_headers_size=%zu\n", opt_headers_size);

  if ((MHD_PROC_RECV_BODY_CHUNKED == stage) &&
      (MHD_MIN_REASONABLE_REQ_CHUNK_LINE_LENGTH_ < add_element_size))
  {
    if (logf)
      fprintf(logf, "RETURN PATH: chunked body and add_element_size too large (%zu > %d). Returning MHD_HTTP_CONTENT_TOO_LARGE\n",
              add_element_size, (int)MHD_MIN_REASONABLE_REQ_CHUNK_LINE_LENGTH_);
    ret = MHD_HTTP_CONTENT_TOO_LARGE;
    goto out;
  }

  host_field_line_size = 0;

  if ((MHD_PROC_RECV_HEADERS == stage)
      && (0 != add_element_size))
  {
    static const size_t header_host_key_len =
      MHD_STATICSTR_LEN_ (MHD_HTTP_HEADER_HOST);
    const bool is_host_header =
      (header_host_key_len + 1 <= add_element_size)
      && ( (0 == add_element[header_host_key_len])
           || (':' == add_element[header_host_key_len]) )
      && MHD_str_equal_caseless_bin_n_ (MHD_HTTP_HEADER_HOST,
                                        add_element,
                                        header_host_key_len);
    if (logf)
      fprintf(logf, "HEADER PROCESS: stage==HEADERS and add_element_size=%zu, header_host_key_len=%zu, is_host_header=%d\n",
              add_element_size, header_host_key_len, (int)is_host_header);
    if (is_host_header)
    {
      const bool is_parsed = ! (
        (MHD_CONNECTION_HEADERS_RECEIVED > c->state) &&
        (add_element_size == c->read_buffer_offset) &&
        (c->read_buffer == add_element) );
      size_t actual_element_size;

      mhd_assert (! is_parsed || (0 == add_element[header_host_key_len]));

      if (is_parsed)
        actual_element_size = add_element_size + 1;  /* "1" for LF */
      else
        actual_element_size = add_element_size;

      host_field_line_size = actual_element_size;
      mhd_assert (opt_headers_size >= actual_element_size);
      opt_headers_size -= actual_element_size;

      if (logf)
        fprintf(logf, "  is_host_header: is_parsed=%d, actual_element_size=%zu, host_field_line_size=%zu, opt_headers_size after subtraction=%zu\n",
                (int)is_parsed, actual_element_size, host_field_line_size, opt_headers_size);
    }
  }

  if (0 == host_field_line_size)
  {
    static const size_t host_field_name_len =
      MHD_STATICSTR_LEN_ (MHD_HTTP_HEADER_HOST);
    size_t host_field_name_value_len;
    if (MHD_NO != MHD_lookup_connection_value_n (c,
                                                 MHD_HEADER_KIND,
                                                 MHD_HTTP_HEADER_HOST,
                                                 host_field_name_len,
                                                 NULL,
                                                 &host_field_name_value_len))
    {
      host_field_line_size =
        host_field_name_len + host_field_name_value_len + 2; /* "2" for ':' and LF */

      if (logf)
        fprintf(logf, "LOOKUP: application-provided Host header found: name_len=%zu, value_len=%zu, initial host_field_line_size=%zu\n",
                host_field_name_len, host_field_name_value_len, host_field_line_size);

      if (opt_headers_size >= host_field_line_size)
      {
        opt_headers_size -= host_field_line_size;
        if (opt_headers_size >= 2)
          opt_headers_size -= 2;

        if (logf)
          fprintf(logf, "  using application-provided Host header: opt_headers_size adjusted=%zu\n", opt_headers_size);
      }
      else
      {
        host_field_line_size = 0; /* No "Host:" field line set by the client */
        if (logf)
          fprintf(logf, "  application-provided Host header too large for opt_headers_size (%zu). host_field_line_size reset to 0\n",
                  opt_headers_size);
      }
    }
    else
    {
      if (logf)
        fprintf(logf, "LOOKUP: application did not set Host header (MHD_lookup_connection_value_n returned no).\n");
    }
  }

  uri_size = c->rq.req_target_len;
  if (MHD_HTTP_MTHD_OTHER != c->rq.http_mthd)
    method_size = 0; /* Do not recommend shorter request method */
  else
  {
    mhd_assert (NULL != c->rq.method);
    method_size = strlen (c->rq.method);
  }

  if (logf)
    fprintf(logf, "SIZES: uri_size=%zu, method_size=%zu, host_field_line_size=%zu, opt_headers_size=%zu\n",
            uri_size, method_size, host_field_line_size, opt_headers_size);

  if ((size_t) MHD_MAX_REASONABLE_HEADERS_SIZE_ < opt_headers_size)
  {
    if (logf)
      fprintf(logf, "BRANCH: opt_headers_size > MHD_MAX_REASONABLE_HEADERS_SIZE_ (%zu > %d)\n",
              opt_headers_size, (int)MHD_MAX_REASONABLE_HEADERS_SIZE_);

    if (opt_headers_size > (uri_size / 8))
    {
      if ((opt_headers_size / 2) > method_size)
      {
        if (logf) fprintf(logf, "RETURN: REQUEST_HEADER_FIELDS_TOO_LARGE (opt_headers_size/2 > method_size)\n");
        ret = MHD_HTTP_REQUEST_HEADER_FIELDS_TOO_LARGE; goto out;
      }
      else
      {
        if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (method too large relative)\n");
        ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
      }
    }
    else
    {
      if ((uri_size / 16) > method_size)
      {
        if (logf) fprintf(logf, "RETURN: URI_TOO_LONG (uri much larger than headers)\n");
        ret = MHD_HTTP_URI_TOO_LONG; goto out;
      }
      else
      {
        if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (method too large relative)\n");
        ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
      }
    }
  }
  if ((size_t) MHD_MAX_REASONABLE_REQ_TARGET_SIZE_ < uri_size)
  {
    if (logf) fprintf(logf, "BRANCH: uri_size > MHD_MAX_REASONABLE_REQ_TARGET_SIZE_ (%zu > %d)\n", uri_size, (int)MHD_MAX_REASONABLE_REQ_TARGET_SIZE_);
    if ((uri_size / 16) > method_size)
    {
      if (logf) fprintf(logf, "RETURN: URI_TOO_LONG (uri_size/16 > method_size)\n");
      ret = MHD_HTTP_URI_TOO_LONG; goto out;
    }
    else
    {
      if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (method too large relative)\n");
      ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
    }
  }

  if ((size_t) MHD_MIN_REASONABLE_HEADERS_SIZE_ < opt_headers_size)
  {
    if (logf) fprintf(logf, "BRANCH: opt_headers_size > MHD_MIN_REASONABLE_HEADERS_SIZE_ (%zu > %d)\n", opt_headers_size, (int)MHD_MIN_REASONABLE_HEADERS_SIZE_);
    if ((opt_headers_size * 4) > uri_size)
    {
      if (opt_headers_size > method_size)
      {
        if (logf) fprintf(logf, "RETURN: REQUEST_HEADER_FIELDS_TOO_LARGE (opt_headers_size > method_size)\n");
        ret = MHD_HTTP_REQUEST_HEADER_FIELDS_TOO_LARGE; goto out;
      }
      else
      {
        if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (method too large relative)\n");
        ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
      }
    }
    else
    {
      if (uri_size > method_size * 4)
      {
        if (logf) fprintf(logf, "RETURN: URI_TOO_LONG (uri_size > method_size*4)\n");
        ret = MHD_HTTP_URI_TOO_LONG; goto out;
      }
      else
      {
        if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (method too large relative)\n");
        ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
      }
    }
  }
  if ((size_t) MHD_MIN_REASONABLE_REQ_TARGET_SIZE_ < uri_size)
  {
    if (logf) fprintf(logf, "BRANCH: uri_size > MHD_MIN_REASONABLE_REQ_TARGET_SIZE_ (%zu > %d)\n", uri_size, (int)MHD_MIN_REASONABLE_REQ_TARGET_SIZE_);
    if (uri_size > method_size * 4)
    {
      if (logf) fprintf(logf, "RETURN: URI_TOO_LONG (uri_size > method_size*4)\n");
      ret = MHD_HTTP_URI_TOO_LONG; goto out;
    }
    else
    {
      if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (method too large relative)\n");
      ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
    }
  }

  if ((size_t) MHD_MIN_REASONABLE_REQ_METHOD_SIZE_ < method_size)
  {
    if (logf) fprintf(logf, "RETURN: NOT_IMPLEMENTED (non-standard long request method)\n");
    ret = MHD_HTTP_NOT_IMPLEMENTED; goto out;
  }

  if ((1 < opt_headers_size) || (1 < uri_size))
  {
    if (opt_headers_size >= uri_size)
    {
      if (logf) fprintf(logf, "RETURN: REQUEST_HEADER_FIELDS_TOO_LARGE (opt_headers_size >= uri_size)\n");
      ret = MHD_HTTP_REQUEST_HEADER_FIELDS_TOO_LARGE; goto out;
    }
    else
    {
      if (logf) fprintf(logf, "RETURN: URI_TOO_LONG (uri_size > opt_headers_size)\n");
      ret = MHD_HTTP_URI_TOO_LONG; goto out;
    }
  }

  if (0 != host_field_line_size)
  {
    if (logf) fprintf(logf, "FINAL RETURN: REQUEST_HEADER_FIELDS_TOO_LARGE (host_field_line_size != 0)\n");
    ret = MHD_HTTP_REQUEST_HEADER_FIELDS_TOO_LARGE; goto out;
  }

  if (logf) fprintf(logf, "FINAL RETURN: URI_TOO_LONG (fall-through)\n");
  ret = MHD_HTTP_URI_TOO_LONG;

out:
  if (logf)
  {
    fprintf(logf, "EXIT get_no_space_err_status_code: ret=%u, final opt_headers_size=%zu, uri_size=%zu, method_size=%zu, host_field_line_size=%zu\n",
            ret, opt_headers_size, uri_size, method_size, host_field_line_size);
    fclose(logf);
  }
  return ret;
}
